    this.refreshUser = this.refreshUser.bind(this);
  }

  componentDidMount(){
    console.log("In componentDidMount: ");
    this.refreshUser();
  }

  refreshUser(){
    UserDataService.retrieveUser('blissofgiving')
      .then(
        response => {
          console.log(response);
        }
      )
  }

  render(){
    return(
      <div className="container">
          <div className="container">
              <table className="table">
                  <tbody>
                      <tr>
                          <td>First Name: </td>
